import React from 'react';
import './ErrorModel.css';
const Backdrop = (props)=>{
    return <div className='oh'></div>

}
const ErrorModel = (props)=>{
    return (        
        <>
            <div className='check'>
                <header>
                    <span>{props.title}</span>
                </header>
                <p>{props.message}</p>
                <footer>    
                    <button onClick = {props.onError}>Okay</button>
                </footer>
            </div>
        </>
    );
}
export default ErrorModel;
